class Solution:
    def maximumLength(self, nums: List[int], k: int) -> int:
        dp = [[1]*len(nums) for _ in range(k+1)]

        for t in range(k+1):
            m = 0
            dic = {}
            for j in range(len(nums)):
                if nums[j] in dic:
                    dp[t][j] = dic[nums[j]] + 1
                if t != 0:
                    dp[t][j] = max(dp[t][j], m + 1)
                    m = max(m, dp[t-1][j])
                dic[nums[j]] = dp[t][j]
        return max([dp[k][j] for j in range(len(nums))])
